class Solution {
  bool checkStrings(String s1, String s2) {
    // Separate characters by even and odd indices for both strings
    List<int> evenCounts1 = List.filled(26, 0);
    List<int> oddCounts1 = List.filled(26, 0);
    List<int> evenCounts2 = List.filled(26, 0);
    List<int> oddCounts2 = List.filled(26, 0);

    for (int i = 0; i < s1.length; i++) {
      if (i % 2 == 0) {
        // Even index
        evenCounts1[s1.codeUnitAt(i) - 'a'.codeUnitAt(0)]++;
        evenCounts2[s2.codeUnitAt(i) - 'a'.codeUnitAt(0)]++;
      } else {
        // Odd index
        oddCounts1[s1.codeUnitAt(i) - 'a'.codeUnitAt(0)]++;
        oddCounts2[s2.codeUnitAt(i) - 'a'.codeUnitAt(0)]++;
      }
    }

    // Compare the character counts for even and odd indices
    for (int i = 0; i < 26; i++) {
      if (evenCounts1[i] != evenCounts2[i] || oddCounts1[i] != oddCounts2[i]) {
        return false;
      }
    }

    return true;
  }
}
